// AdminDashboard.js
import { useNavigate } from 'react-router-dom';
import React, { useState } from 'react';
import axios from 'axios';
import './AdminDashboard.css'; // Import your CSS file

function AdminDashboard({
  newEvent: { name: newEventName = '', link: newEventLink = '' },
  setNewEvent,
  newResult: { name: newResultName = '', link: newResultLink = '' },
  setNewResult,
  handleAddEvent,
  handleAddResult,
}) {
  const navigate = useNavigate();

  const handleEventInputChange = (e) => {
    setNewEvent({ ...newEvent, [e.target.name]: e.target.value });
  };

  const handleResultInputChange = (e) => {
    setNewResult({ ...newResult, [e.target.name]: e.target.value });
  };

  return (
    <div className="admin-dashboard">
      <h2>Admin Dashboard</h2>
      <div className="admin-form">
        <div>
          <label>Add New Event</label>
          <input
            type="text"
            placeholder="Event Name"
            name="name"
            value={newEventName}
            onChange={handleEventInputChange}
          />
          <input
            type="text"
            placeholder="Event Link"
            name="link"
            value={newEventLink}
            onChange={handleEventInputChange}
          />
          <button onClick={handleAddEvent}>Add Event</button>
        </div>
        <div>
          <label>Add New Result</label>
          <input
            type="text"
            placeholder="Result Name"
            name="name"
            value={newResultName}
            onChange={handleResultInputChange}
          />
          <input
            type="text"
            placeholder="Result Link"
            name="link"
            value={newResultLink}
            onChange={handleResultInputChange}
          />
          <button onClick={handleAddResult}>Add Result</button>
        </div>
      </div>
    </div>
  );
}

export default AdminDashboard;
